import React from "react";
import { TextField, withStyles, useStyles } from "@material-ui/core";
const styles = inputStyle({
  color: "red"
});

const NavBarSearch = () => {
  return (
    <>
      <form style={styles.inputStyle} color="red" noValidate autoComplete="off">
        <TextField id="standard-basic" label="Search" />
      </form>
    </>
  );
};

export default NavBarSearch;
